import Vue from 'vue'

import App from './App.vue'


// 可以实现让所有组件都看到这个属性，但不推荐
// window.x = {a: 1, b: 2}

Vue.prototype.x = {a: 1, b: 2}
new Vue({
    el: '#app',
    render: h => h(App)
})
